import { Button, ButtonGroup, Grid, TextField } from '@material-ui/core';
import React from 'react';

const buttons = [
    <Button key = "git">Sign in using GitHub</Button>,
    <Button key = "google">Sign in using Google Account</Button>,
    <Button key = "exist">Sign in using exist account</Button>
];

export default function Login () {
    return(
        <Grid container>
            <Grid item xs = {0} md = {8}>
                <h1>hi</h1>
            </Grid>
            <Grid item container xs = {12} sm = {8}>
                <ButtonGroup orientation = 'vertical'>
                    {buttons}
                </ButtonGroup>
            </Grid>
        </Grid>
    );
}

<Grid container direction = 'column'>
            <Grid item>
                <Navbar />
            </Grid>
            <Grid item container>
                <Grid item xs = {0} sm = {4}>
                    show interfaces
                </Grid>
                <Grid item xs = {12} sm = {8} > {/* (#/12) represent the percentage on the screen when it is extra small(xs) or small(sm)*/}
                    <Content value = {20}/>
                    content due to interfaces
                </Grid>
            </Grid>
       </Grid>
